import Homepage from "./components/home/Homepage";
import Register from "./components/register/Register";
import Login from "./components/login/Login";
import React, { useState } from "react";
import { Routes, Route } from "react-router-dom";

export const UserContext = React.createContext();

function App() {

  const [loggedUser, setloggedUser] = useState(localStorage.getItem('token'));

  return (
    <div className="App">
        <Routes>
          {(loggedUser !== null) ? (<Route exact path="/" element={<Homepage setloggedUser={loggedUser}/>}/>) : (<Route exact path="/Login" element={<Login setloggedUser={setloggedUser}/>}/>)}
          <Route exact path="/Register" element={<Register />}/>
        </Routes>
        {console.log(loggedUser)}
    </div>
  );
}

export default App;
